# Script to download GISAID data
# probably using Selenium or BeautifulSoup or something like that

import os
import re as regex
import selenium
import sys
import time
import pandas as pd 

from selenium import webdriver
from selenium.webdriver.common.keys import Keys
from selenium.webdriver.common.action_chains import ActionChains
from selenium.webdriver.common.desired_capabilities import DesiredCapabilities
from selenium.common.exceptions import NoSuchElementException

refSequence=""

def main() :

	data_folder = "."
	driver_name = "geckodriver"
	driver_absolute_path = os.path.abspath( os.path.join(data_folder, driver_name) )

	website_login = "http://www.bioinformatics.nl/cgi-bin/primer3plus/primer3plus.cgi"
	
	
	
	# setup some preferences for Firefox (cut/pasted from Stack Overflow)
	profile = webdriver.FirefoxProfile(os.path.abspath("selenium-firefox-profile"))
	profile.set_preference("browser.download.dir", os.path.abspath(data_folder))
	profile.set_preference("browser.download.folderList", 2)
	profile.set_preference("browser.helperApps.neverAsk.saveToDisk", "text/plain, text/x-csv, text/csv, application/vnd.ms-excel, application/csv, application/x-csv, text/csv, text/comma-separated-values, text/x-comma-separated-values, text/tab-separated-values, application/pdf, application/octect-stream, application/fasta, application/x-unknown, text/x-fasta, application/x-fasta")
	profile.set_preference("browser.download.manager.showWhenStarting", False)
	profile.set_preference("browser.helperApps.neverAsk.openFile","text/plain, text/x-csv, text/csv, application/vnd.ms-excel, application/csv, application/x-csv, text/csv, text/comma-separated-values, text/x-comma-separated-values, text/tab-separated-values, application/pdf, application/fasta, application/octect-stream, application/x-unknown, text/x-fasta, application/x-fasta")
	profile.set_preference("browser.helperApps.alwaysAsk.force", False)
	profile.set_preference("browser.download.manager.useWindow", False)
	profile.set_preference("browser.download.manager.focusWhenStarting", False)

	#profile.set_preference("browser.helperApps.neverAsk.openFile", "*/*")
	#profile.set_preference("browser.helperApps.neverAsk.saveToDisk", "*/*")

	profile.set_preference("browser.download.manager.alertOnEXEOpen", False)
	profile.set_preference("browser.download.manager.showAlertOnComplete", False)
	profile.set_preference("browser.download.manager.closeWhenDone", True)
	profile.set_preference("pdfjs.disabled", True)

	caps = DesiredCapabilities.FIREFOX

	# start browser
	print("Starting browser and connecting to \"%s\"..." % website_login)
	driver = webdriver.Firefox(executable_path=driver_absolute_path, firefox_profile=profile, capabilities=caps)
	
	
	candidatesPrimers = pd.read_csv("candidates.csv", header=None).values.ravel()
	results=[]
	for i in range(0,len(candidatesPrimers)):
	
	
		# connect to webpage and login
		driver.get(website_login)
		
		form_sequenceTextarea = driver.find_element_by_id('sequenceTextarea')
		form_sequenceTextarea.send_keys(refSequence)
		
		form_SEQUENCE_PRIMER = driver.find_element_by_id('PRIMER_LEFT_INPUT')
		form_SEQUENCE_PRIMER.send_keys(str(candidatesPrimers[i]))
		time.sleep(5)
		form_primer3plus_pick_primers_button=driver.find_element_by_id('primer3plus_pick_primers_button')
		form_primer3plus_pick_primers_button.click()
		
		
		
		try :
		
			errors=driver.find_element_by_class_name('primer3plus_note')
			note= errors.text;
			#driver.find_element_by_class_name('primer3plus_cell_no_border_problem')
			print(str(candidatesPrimers[i])+"\t"+note)
			results.append(str(candidatesPrimers[i])+"\t"+note)
		except:
			reverse_Primer=driver.find_element_by_id('PRIMER_1_SEQUENCE')
			print(str(candidatesPrimers[i])+"\t"+str(reverse_Primer.get_attribute("value")))
			results.append(str(candidatesPrimers[i])+"\t"+str(reverse_Primer.get_attribute("value")))
	# close browser
	pd.DataFrame(results).to_csv("./results.tsv", header=None, index =None)
	driver.close()
	return

if __name__ == "__main__" :
	sys.exit( main() )
